import React from "react";
import styled from "styled-components";
import FrontData from "./FrontPage";
import SecondPage from "./SecondPage";

function ModelS() {
  return (
    <Container>
      <FrontData />
      <SecondPage />
    </Container>
  );
}

const Container = styled.div`
  height: 100vh;
`;
export default ModelS;
